export default function Navigation() {
	return (
		<div>
			<div className='Navbar'>
				<Link className='NavbarMenu' to={'/'}>Main</Link>
				<Link className='NavbarMenu' to={'/menu'}>메뉴</Link>
				<Link className='NavbarMenu' to={'/user'}>유저</Link>
			</div>
		</div>
	  );
}
